import {BrowserRouter,Routes, Route } from 'react-router-dom';
import HomePage from './home';

function App() {
  return(
    <BrowserRouter>
    <Routes>
    <Route path="/" element={<HomePage />} />
    </Routes>
    </BrowserRouter>
  )
}

export default App;
